import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open a product detail modal (simulate clicking the first product)
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const firstProduct = await page.$('.product-card');
    await firstProduct.click();

    // Wait for the product modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('#productModal[style*="display: block"]', { timeout: 5000 });

    // Take screenshot of product modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // Change quantity to 3 in the modal
    await page.waitForSelector('#quantity', { timeout: 5000 });
    await page.selectOption('#quantity', '3');

    // Take screenshot after changing quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_selected.png'));

    // Click "Add to Cart" button in the modal
    await page.waitForSelector('.add-to-cart.large', { timeout: 5000 });
    await page.click('.add-to-cart.large');

    // Wait for notification to appear (success message)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_added_to_cart.png'));

    // Close the product modal
    await page.waitForSelector('#productModal .close', { timeout: 5000 });
    await page.click('#productModal .close');

    // Open the cart modal (simulate clicking cart icon/counter)
    // Try multiple selectors for cart
    let cartSelector = '#cartCount';
    await page.waitForSelector(cartSelector, { timeout: 5000 });
    await page.click(cartSelector);

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });

    // Take screenshot of cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_cart_modal.png'));

    // Find the first cart item and increase quantity by 1 (from 3 to 4)
    await page.waitForSelector('.cart-item', { timeout: 5000 });
    const plusBtn = await page.$('.cart-item .quantity-btn:nth-of-type(2)');
    await plusBtn.click();

    // Wait for cart to update (quantity text should update to 4)
    await page.waitForFunction(() => {
      const el = document.querySelector('.cart-item .quantity');
      return el && el.textContent.trim() === '4';
    }, { timeout: 5000 });

    // Take screenshot after updating quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_quantity_updated.png'));

    // Extract cart item data for verification
    const cartItem = await page.$('.cart-item');
    const title = await cartItem.$eval('.cart-item-title', el => el.textContent.trim());
    const quantity = await cartItem.$eval('.quantity', el => el.textContent.trim());
    const price = await cartItem.$eval('.cart-item-price', el => el.textContent.trim());

    return {
      success: true,
      action: "Updated cart item quantity from 3 to 4 using cart modal controls",
      extractedData: {
        cartItem: {
          title,
          quantity,
          price
        }
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
